import './App.css';
// used for making things display as loading prior to render
import Skeleton from 'react-loading-skeleton';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Welcome to empty lacuna. Soon to be great! 
        </p>
      </header>
    </div>
  );
}

export default App;
